import React, { Component } from 'react';
import axios from 'axios';

export default class Form extends Component {
  constructor(props) {
    super(props);
    this.state = {
        items: [],
        isLoaded: false
    }

}
componentDidMount() {

  fetch('https://jmulu03w55.execute-api.us-east-1.amazonaws.com/dev')
      .then(res => res.json())
      .then(json => {
          this.setState({
              items: json,
              isLoaded: true, 
          })
      }).catch((err) => {
          console.log(err);
      });

}

render() {

  const { isLoaded, items } = this.state;

  if (!isLoaded)
      return <div>Loading...</div>;

  return (
      <div className="App">
          <ul>
              {items.map(item => (
                  <li key={item.name}>
                      Name: {item.name} | Genres: {item.genres} |Email: {item.description}
                  </li>
              ))}
          </ul>
      </div>
  );

}

}
